import React from "react"; 
import { Button,Box,TextField,Container, TableRow } from "@mui/material";
function Login() {


    return(
        <Box sx={{ width: '100%', maxWidth: 360, bgcolor: 'success.dark' }}>
<TableRow>

<TextField id="outlined-basic" label="Username" variant="outlined" />
    </TableRow>  
    <TableRow>

<TextField id="outlined-basic" label="Username" variant="outlined" />
    </TableRow>  
        <TextField
          id="outlined-password-input"
          label="Password"
          type="password"
          autoComplete="current-password"
        />
        <Button variant="contained">Login</Button>
      </Box>
    );
}

export default Login;
